import React from "react";
import css from "./User.module.css";

const User = (props) => {
  return (
    <div className={css.form} key={props.user.id}>
      <div className={css.person}>
        <img src={props.user.img} />
      </div>
      <div className={css.data}>
        <div className={css.fullName}>{props.user.fullName}</div>
        <div className={css.inData}>
          <div className={css.location}>
            {props.user.location.country} - {props.user.location.city}
          </div>
          <div className={css.status}>"{props.user.status}"</div>
        </div>
      </div>
      <div className={css.button}>
        <button className={css.followBn}>
          <text>FOLLOW</text>
        </button>
      </div>
    </div>
  );
};

export default User;
